import styles from './Banner.module.css';
import minhaFoto from '../../assets/minha-foto.webp';

export default function Banner() {
    return (
        <>
            <div className={styles.banner}>
                <div className={styles.apresentacao}>
                    <h1 className={styles.titulo}>
                        Rick and Morty
                    </h1>

                    <p className={styles.paragrafo}>
                        Rick and Morty is an animated series that follows the adventures and discoveries of a super scientist and his not-so-bright grandson. Completely irresponsible, Rick is not a loving and kind grandfather. Quite the opposite, he uses his grandson, Morty, as a guinea pig in his experiments and doesn't take into account the young boy's safety in their intergalactic escapades.
                    </p>
                </div>

                <div className={styles.imagens}>
                    <img
                        className={styles.minhaFoto}
                        src={minhaFoto}

                    />
                </div>

            </div>
        </>
    );
}
